import "./navbar.scss"
import HomeIcon from '@mui/icons-material/Home';
import ChatBubbleOutlineIcon from '@mui/icons-material/ChatBubbleOutline';
import AccountCircleIcon from '@mui/icons-material/AccountCircle';
import SearchOutlinedIcon from "@mui/icons-material/SearchOutlined";
import { useContext, useState } from "react";
import { Link } from "react-router-dom";
import { AuthContext } from "../../contexts/authContext";
import axios from "axios";


function Navbar() {
  const { currentUser } = useContext(AuthContext);
  const [search, setSearch] = useState(null);
  const [searchAllUsers, setSearchAllUsers] = useState([]);


  const handleChange = e => {
    setSearch(e.target.value)
  };

  const handleClick = async (inputs) => {
    const res = await axios.get("http://localhost:3001/api/users/find/allUsers", {
      withCredentials: true, // needed for working with cookies
    });
    setSearchAllUsers(res.data);

    // Add this code to map and console log the filtered users
    const filteredUsers = searchAllUsers.filter((user) =>
      user.name.toLowerCase().includes(search.toLowerCase())
    );
  };



  if (filteredUsers.length > 0) {
    console.log("Filtered Users:", filteredUsers);
  }


  return (
    <div className="navbar">
      <div className="left">
        <h1>trustSocial</h1>
      </div>
      <div className="middle">
        <div className="icons">
          <Link to="/">
            <HomeIcon
              className="button"
              fontSize="large"
            />
          </Link>
          <ChatBubbleOutlineIcon
            className="button"
            fontSize="large"
          />
          <Link to={`profile/${currentUser.id}`}>
            <AccountCircleIcon
              className="button"
              fontSize="large"
            />
          </Link>
        </div>
      </div>
      <div className="right">
        <div className="search">
          <SearchOutlinedIcon className="searchButton" onClick={handleClick} />
          <input type="text"
            placeholder="Search trustMe..."
            name="search"
            onChange={handleChange}
          />
        </div>
      </div>
    </div>
  )
}

export default Navbar
